import countries from 'world-countries'

const CountryInfo = (countries) => {
  // console.log(countries)

  const test = countries[0].name
  return (
    <p>test</p>
  )
}

const App = (props) => {
  return (
    <div>
      <p>Skriv detta: <CountryInfo data={countries[0]} /></p>
    </div>
  )
}

export default App
